import '../styles/Card.css'

const Card = (props) => {
    const imgSource = `/assets/${props.imgSource}.png`

    return(
        <div key={props.title} className="main-card" id={`${props.title}`}>
            <img alt="" src={imgSource} />
            <h3>{props.title}</h3>
        </div>
    )
}

export default Card;
